Мне нравится В ГЕРМАНИИ:
- что нет ограничений на продажу алкоголя и в магазине напротив до 23.30 я могу купить отличного вина за 5-7 евро;
- качество продуктов;
- что в свои тридцать-с-хером я никак не ощущаю свой возраст, и никто не парится об этом; 
- свежий воздух в городе.

Мне НЕ нравится В Германии:
- плохой сервис, ужасные косметологи, маникюрные мастера, парикмахеры - все ходят к русским, у немцев ещё и запись за месяц минимум, просто жесть;
- дороговизна сервиса на грани безумия (вытащить из помпы стиральной машинки шнурок - 180 евро).

- возможность летать по Европе за 25-75 евро;
- чисто берлинское - много стрит-фуда, это кстати в Европе не везде так;
- возможность ходить на крутые концерты любимых групп и шоу;
- ощущение стабильности (банально, да? Но факт).
